import React from 'react';
import './pages.css';
import Navbar from '../components/navbar/Navbar';
import image from '../images/header-backgrounds/team.jpg'
import Footer from '../components/footer/Footer';
import Header from '../components/header/Header';
import Position from '../components/player/Position';
import data from '../components/player/player-data'



export default function Team(){

    let bramkarze = data[0]
    let rozgrywajacy = data[1]
    let skrzydlowi = data[2]
    let obrotowi = data[3]
    return(
        <div className="team-wrapper">
            <Navbar />
            <Header 
                src={image}
                text="Zespół"
                />
            <Position 
                positionName="Bramkarze"
                data={bramkarze}
                />
            <Position 
                positionName="Rozgrywający"
                data={rozgrywajacy}
                />
            <Footer />
        </div>
    )
}
